import React from 'react';

const Findlist = ({users, friends}) => {
  return (
    <div>
      <ul>
        {users.map(user => (
          <li key={user.id}>{user.nickname} 
            { friends.some(f => f.userId == user.id) 
              ? <button onClick={() => {}}>+</button>
              : null
            }
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Findlist;
